    false,nt"url": null,nt"notes": "This annual narrative report for Benton
    Lake National Wildlife Refuge outlines Refuge accomplishments during the 1993 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses compliance with environmental
    and cultural resource mandates and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, grasslands, and pest control. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, animal control, marking
    and banding, and disease control. The public uses of the Refuge described in this
    report include outdoor classrooms, interpretive programs, and hunting. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    and computer systems. Items of interest are provided at the end.",nt"license_title":
